k// src/pages/RPGDashboard.js
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { supabase } from '../supabaseClient';
import sampleChallenges from '../data/sampleChallenges';

const RPGDashboard = () => {
  const { id } = useParams();
  const [session, setSession] = useState(null);
  const [quest, setQuest] = useState(null);
  const [showQuiz, setShowQuiz] = useState(false);
  const [answers, setAnswers] = useState([]);
  const [score, setScore] = useState(null);
  const [shuffledQuestions, setShuffledQuestions] = useState([]);
  const [currentQuestion, setCurrentQuestion] = useState(0);

  useEffect(() => {
    supabase.auth.getSession().then(({ data: { session } }) => {
      setSession(session);
    });
  }, []);

  useEffect(() => {
    const questData = sampleChallenges.find(q => q.id === parseInt(id));
    setQuest(questData);
    if (questData) {
      const shuffled = [...questData.quiz.questions].sort(() => 0.5 - Math.random()).slice(0, 10);
      setShuffledQuestions(shuffled);
    }
  }, [id]);

  const handleAnswer = (selectedIndex) => {
    const updated = [...answers];
    updated[currentQuestion] = selectedIndex;
    setAnswers(updated);
    if (currentQuestion < shuffledQuestions.length - 1) {
      setCurrentQuestion(prev => prev + 1);
    } else {
      handleSubmit(updated);
    }
  };

  const handleSubmit = (finalAnswers) => {
    let correct = 0;
    shuffledQuestions.forEach((q, i) => {
      if (finalAnswers[i] === q.correctIndex) correct++;
    });
    setScore(correct);
  };

  if (!session) return <p className="text-white p-6">Loading session...</p>;
  if (!quest) return <p className="text-white p-6">Quest not found</p>;

  return (
    <div className="px-6 py-8 text-white min-h-screen bg-gradient-to-b from-gray-900 via-gray-800 to-gray-900">
      <h1 className="text-3xl font-bold mb-2">{quest.title}</h1>
      <p className="text-gray-400 mb-4">{quest.description}</p>

      {!showQuiz ? (
        <>
          <div className="bg-gray-800 p-4 rounded shadow">
            <h2 className="text-xl font-semibold mb-4">Tutorial</h2>
            <pre className="whitespace-pre-wrap text-sm text-gray-300">
{quest.tutorial}

---

🔍 This tutorial includes expanded content on phishing tactics, real-world case examples, and defensive strategies for identifying and avoiding phishing attacks.
            </pre>
          </div>
          <button
            onClick={() => setShowQuiz(true)}
            className="mt-6 bg-purple-600 hover:bg-purple-700 px-4 py-2 rounded"
          >
            Start Quiz
          </button>
        </>
      ) : (
        <div className="mt-6">
          <h2 className="text-xl font-bold mb-4">Quiz</h2>
          {score === null ? (
            <div className="mb-4 p-4 bg-gray-800 rounded">
              <p className="font-semibold mb-4">
                {currentQuestion + 1}. {shuffledQuestions[currentQuestion].question}
              </p>
              <div className="grid gap-2">
                {shuffledQuestions[currentQuestion].options.map((opt, i) => (
                  <button
                    key={i}
                    onClick={() => handleAnswer(i)}
                    className="text-left w-full bg-gray-700 hover:bg-purple-600 p-3 rounded transition"
                  >
                    {opt}
                  </button>
                ))}
              </div>
            </div>
          ) : (
            <div className="mt-6 p-4 bg-gray-700 rounded">
              <h3 className="text-lg font-bold mb-2">Results</h3>
              <p className="mb-2">Score: {score} / {shuffledQuestions.length}</p>
              {shuffledQuestions.map((q, i) => (
                <div key={i} className="mb-2">
                  <p className="text-sm">
                    <span className="font-semibold">Q{i + 1}: </span>{q.question}
                    <br />
                    <span className="text-green-400">Correct: {q.options[q.correctIndex]}</span>
                    <br />
                    <span className={answers[i] === q.correctIndex ? 'text-green-400' : 'text-red-400'}>
                      Your Answer: {q.options[answers[i]] || 'None'}
                    </span>
                  </p>
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default RPGDashboard;
